
create table huid_lightning_dataset_map (
  id integer primary key,
  human_id varchar(255),
  dataset_name varchar(255)
);


create index huid_lightning_dataset_map_huid on huid_lightning_dataset_map (human_id);
create index huid_lightning_dataset_map_dataset_name on huid_lightning_dataset_map (dataset_name);
create index huid_lightning_dataset_map_huid_dataset_name on huid_lightning_dataset_map (human_id, dataset_name);



